// Main JS
jQuery(function ($) {
    // Responsive
    var jBody = $('body');
    if( /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent) ) {
      jBody.addClass('touch-device');
    }

    // Fix Input Iphone
    if (/iPhone/.test(navigator.userAgent) && !window.MSStream) {
      $('input, textarea, select').mousedown(function(){
        $('meta[name=viewport]').remove();
        $('head').append('<meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no, user-scalable=0">');
      })

      $('input, textarea, select').focusout(function(){
        $('meta[name=viewport]').remove();
        $('head').append('<meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">' );
      })
    }

    // Tooltip
    $('[data-toggle="tooltip"]').tooltip();

    // CMS Table
    $( ".cms-wrap table" ).wrap('<div class="table-responsive"></div>');

    // Swipe Carousel
    $('#carousel-diapo, #carousel-home').hammer().on('swipeleft', function(){
      $(this).carousel('next');
    });
    $('#carousel-diapo, #carousel-home').hammer().on('swiperight', function(){
      $(this).carousel('prev');
    });

    // Carousel Favorite
    $('.carousel-favorite').owlCarousel({
      margin: 40,
      nav: false,
      responsive:{
          0:{
              items:1,
              loop:true,
              autoplay:true
          },
          768:{
              items:2,
              loop: true,
              autoplay:true
          },
          1024:{
              items:4,
              loop:false
          }
      }
    });

    // Carousel news
    $('.carousel-news').owlCarousel({
      margin: 40,
      nav: false,
      responsive:{
          0:{
              items:1,
              loop:true,
              autoplay:true
          },
          768:{
              items:2,
              loop:true,
              autoplay:true
          },
          1024:{
              items:3,
              loop:false
          }
      }
    });

    // Carousel library
    $('.carousel-library').owlCarousel({
      margin: 10,
      nav: true,
      loop: $('.library-item').length > 4,
      autoplay: true,
      responsive:{
          0:{
              items:1
          },
          768:{
              items:2
          },
          1024:{
              items:3,
              dots: false
          },
          1280:{
              items:4,
              dots: false
          }
      }
    });

    // Carousel author
    $('.carousel-author').owlCarousel({
      margin: 40,
      nav: false,
      responsive:{
          0:{
              items:1,
              loop:true,
              autoplay:true
          },
          768:{
              items:2,
              loop: true,
              autoplay:true
          },
          1024:{
              items:4,
              loop:false
          }
      }
    });

    // Media
    $('.carousel-media').owlCarousel({
      items:1,
      merge:false,
      loop:true,
      margin:0,
      video:true,
      center:true
    });

    //
    $('.carousel-info').owlCarousel({
      margin: 20,
      nav: true,
      dots: false,
      loop:false,
      autoWidth:true,
      responsive:{
          0:{
              items:1,
              autoWidth:false,
              nav: true
          },
          768:{
              items:2,
              nav: true
          },
          1024:{
            nav: false
          }
      }
    });

    // Library number
    $('.library-number').html(function(i, v){
        var html = v.split(',');
        return html[0] + ',' + '<span class="decimal">' + html[1] + '</span>'
    });

    // Rellax
    if ($('.rellax').length > 0) {
      var rellax = new Rellax('.rellax');
    }

    // AOS
    AOS.init();

    // Header
    $(window).scroll(function() {
    var scroll = $(window).scrollTop();
        if (scroll >= 10) {
            $(".header-wrap").addClass("header-fix-wrap");
        } else {
            $(".header-wrap").removeClass("header-fix-wrap");
        }
    });

    // Menu mobile
    var btnMobile = $('.btn-menu-mobile');
    btnMobile.click(function() {
      $(this).toggleClass('active');
      $('.nav-mobile-block').toggleClass('active');
      $('.main-container').toggleClass('active');
      $('html,body').animate({ scrollTop: 0 }, 700);
      $('body').toggleClass('active-menu');
    });

    // Link Select Filter
    var linkSelect = $('.link-select');
    linkSelect.click(function() {
      $(this).toggleClass('active');
      $('.link-filter').removeClass('active');
      $('.search-advanced-default-form').slideUp();
      $('.search-advanced-select-form').slideToggle();
    });

    // Link Select Filter
    var linkFilter = $('.link-filter');
    linkFilter.click(function() {
      $(this).toggleClass('active');
      $('.link-select').removeClass('active');
      $('.search-advanced-select-form').slideUp();
      $('.search-advanced-default-form').slideToggle();
    });

    // Link Category
    var linkCatgory = $('.category-parent-item .category-item-link');
    linkCatgory.click(function() {
      $(this).toggleClass('active');
      $(this).next('.category-subcategory-block').slideToggle();
    });

    // Link tag
    var linkTaf = $('.btn-add-tag');
    linkTaf.click(function() {
      $('.new-tag-form').slideToggle();
    });

    // Edit folder
    var btnCreateFolder = $('.btn-create-folder');
    btnCreateFolder.click(function() {
      $(this).hide();
      $('.create-folder-form').show();
    });

    var btnCreateShareFolder = $('.btn-create-shared-folder');
    btnCreateShareFolder.click(function() {
        $(this).hide();
        $('.create-folder-shared-form').show();
    });

    // Edit name folder
    var linkEditNameFolder = $('.edit-name-link');
    linkEditNameFolder.click(function() {
      $('a.edit-name-link').toggle();
      $('.folder-name-title-block').toggle();
      $('.name-folder-form').toggle();
      $('.create-folder-form').toggle();
    });

    var linkEditNameFolder = $('.edit-shared-name-link');
    linkEditNameFolder.click(function() {
      $('a.edit-shared-name-link').toggle();
      //$('.folder-name-title-block').toggle();
      $('.name-folder-form').toggle();
      $('.create-folder-shared-form').toggle();
    });

    // Link modify address
    var linkAddress = $('.link-modify');
    linkAddress.click(function() {
      $(this).parents('.order-address-block').next().slideToggle();
    });


    // Nav home
    var btnRevival = $('.event-block');
    btnRevival.click(function() {
      var idLink = $(this).data('link');
      $(this).addClass('active');
      btnRevival.not(this).removeClass('active');

      $('.event-detail').each(function(){
        if( $(this).attr('data-detail') == idLink ){
          $('.event-detail').not(this).removeClass('active');
          $(this).addClass('active');
        }
      });
    });

    $( '.order-facturation-form' ).on('click', '.btn.form-submit',function(){
      console.log('click');
      $('html, body').animate( { scrollTop: 0 }, 300 ); // Go
    });

    // Datepicker
    $('.form-datepicker').datepicker({
      format: 'dd/mm/yyyy',
      // startDate: '-3d',
      language : 'fr'
    });


    // Order inscription
    var linkInscription = $('.row-inscription .col-sm-4:first-child a');
    linkInscription.click(function() {
      $('.row-inscription a').removeClass('active');
      $(this).addClass('active');
      $('.order-inscription-form').removeClass('active');
      $('.order-inscript-form-1').addClass('active');
    });

    var linkInscription1 = $('.row-inscription .col-sm-4:nth-child(2) a');
    linkInscription1.click(function() {
      $('.row-inscription a').removeClass('active');
      $(this).addClass('active');
      $('.order-inscription-form').removeClass('active');
      $('.order-inscript-form-2').addClass('active');
    });

    var linkInscription2 = $('.row-inscription .col-sm-4:nth-child(3) a');
    linkInscription2.click(function() {
      $('.row-inscription a').removeClass('active');
      $(this).addClass('active');
      $('.order-inscription-form').removeClass('active');
      $('.order-inscript-form-3').addClass('active');
    });

    // Payment
    var linkP = $('.type-payment-list li:first-child label');
    linkP.click(function() {
      $(this).prev().attr( 'checked', 'checked' );
      $('.order-card-block').addClass('active');
      $('.order-check-block, .order-mandat-block').removeClass('active');
    });
    var linkP1 = $('.type-payment-list li:nth-child(2) label');
    linkP1.click(function() {
      $(this).prev().attr( 'checked', 'checked' );
      $('.order-check-block').addClass('active');
      $('.order-card-block, .order-mandat-block').removeClass('active');
    });
    var linkP2 = $('.type-payment-list li:nth-child(3) label');
    linkP2.click(function() {
      $(this).prev().attr( 'checked', 'checked' );
      $('.order-mandat-block').addClass('active');
      $('.order-check-block, .order-card-block').removeClass('active');
    });
});

